def filter_unique_elements(a_str, b_str, c_str):
    # 处理输入并过滤空元素
    list_a = [x.strip() for x in a_str.split(',') if x.strip()]
    list_b = [x.strip() for x in b_str.split(',') if x.strip()]
    list_c = [x.strip() for x in c_str.split(',') if x.strip()]

    # 创建排除集合（a和b的并集）
    exclude = set(list_a + list_b)

    # 过滤c中元素（保留原顺序）
    result = [item for item in list_c if item not in exclude]

    return result


